import React from 'react';
import './styles/Header.css';
import profilePicture from "../assets/pic.jpg"

function Header() {
  return (
    <header className="header">
      <div className="profile-picture-container">
        <img src={profilePicture} alt="Deepak Raj" className="profile-picture" />
      </div>
      <h1 className="header-name">Deepak Raj</h1>
      <p className="tags"><b>Developer</b> || <b>Traveller</b></p>
    </header>
  );
}

export default Header;
